css:
@-moz-document domain("www.jobstreet.com.ph") {
.wrap {
    background-color: #142639;
}
.panel-body,
.search-bar,
.advanced-bar {
    background-color: #182C41;
    color: #FFF !important;
}
.logo-ph {
    visibility: hidden;
}
.navbar-default {
    visibility: hidden;
    display: none;
}
#right_banner_panel {
    visibility: hidden;
}
.img-company-logo {
    visibility: hidden;
}
.btn-block {
    background-color: #142639;
    color: #FFF;
}
#saved_search_body_1 {
    display: none;
}
.mobile-navbar-fixed-top {
    background-color: #142639;
}
.page-title {
    visibility: hidden;
}
.search-bar {
    background-color: #142639 !important;
}
a {
    color: #FFF !important;
}
.form-control,
.qsphIptKey,
.select2-selection__rendered {
    background-color: #142639 !important;
    color: #FFF !important;
}
li {
    color: #FFF !important;
}
h2 {
    color:#5FCF80 !important;
}
span {
    color:#DB5599;
}
ul {
    color:#FF7D4F !important;
}

}
